import Vue from 'vue';
import Vuetify from 'vuetify';
import 'vuetify/dist/vuetify.min.css';

Vue.use(Vuetify);

const opts = {} // Опции для конфигурации Vuetify

new Vue({
  vuetify: new Vuetify(opts),
}).$mount('#app');
